class BaseService {
    get(url, params = null) {
        return fetch(url, {
            method: 'GET',
            headers: {
                'Access-Control-Allow-Origin': '*',
                // Accept: 'application/json, text/plain, */*',
                // 'Content-Type': 'application/json;charset=UTF-8',
            }
        });
    }
}

const baseService = new BaseService();
export default baseService;
